As photographers, we’re always chasing the perfect light wherever we go. Driven by passion, we have an unwavering determination to get “the shot”. Light is the key ingredient in any photograph, and photography is about learning how to sculpt that light.

@conormccann and I spent a month shooting this project while living out of vans down in California. We’ve travelled together a ton of times over the years, but this was our first time collaborating on a video, so it’s a special one.

And a huge shoutout to @corona for trusting my creative vision.

I couldn’t count the number of times @josiahwg has come to me with some sort of crazy idea. This was one of his more ambitious creative endeavours and he executed it flawlessly. 

@josiahwg, @chelseakauai, @samkolder, @sashajuliard, @tulum.breathtaking and @camitorresph spent 14 days diving mostly at 100ft (30m) down to film this. They only had around 15 minutes each day at the bottom of the Cenote so they needed to have everything planned perfectly. 

Shooting underwater is difficult as-is. Shooting an entire short film at depth underwater is an entirely different beast. 

After it was shot, @josiahwg sent it to me where I slowly pulled everything together in the editing studio. 

@matthewmorganmusic created an original score for the film and I couldn’t imagine any other music with these stunning visuals. 

Enjoy.

Flow state is that feeling of energized focus when you immerse yourself in something you love. That feeling of getting so in the zone, you start preforming at the absolute peak of your abilities. 
@chelseakauai and I decided to explore this concept and how you can tap into your "flow state".

Special thanks to @samkolder and @kylor for helping with the footage, and to @corona for making this one possible.

This was one of the most hectic, spontaneous and fun trips I have ever been on. We picked up these electric cars in Oslo and decided to drive them to Lofoten and back in 10 days. 
We had basically no plan and no preparation. Definitely not the best idea... Once we got to Lofoten, the sun never actually made it over the horizon... so most of our trip was spent in the dark.
